// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./Generador.sol";
import "./Comercializador.sol";
import "./models/InfoContrato.sol";
import "./libraries/Validations.sol";
import "./Cliente.sol";
import "./models/Factory.sol";

contract MvmClienteFactory is Factory {
    mapping(address => address) public DirContratosClientes;

    constructor(address _reguladorMercado) {
        owner = msg.sender;
        dirContrato = address(this);
        reguladorMercado = _reguladorMercado;
    }

    event CreacionCliente(string, address);

    function factoryCliente(
        string memory _empresa,
        uint256 _nit,
        string memory _contacto,
        string memory _telefono,
        string memory _correo,
        string memory _direccion,
        string memory _ciudad,
        string memory _departamento
    ) public {
        require(
            Validations.aproveCreation(msg.sender, contratosOwners),
            "El cliente ya existe"
        );
        DirContratosClientes[msg.sender] = address(
            new Cliente(
                _empresa,
                _nit,
                _contacto,
                _telefono,
                _correo,
                _direccion,
                _ciudad,
                _departamento,
                msg.sender,
                reguladorMercado
            )
        );

        contratosOwners.push(
            infoContrato(msg.sender, DirContratosClientes[msg.sender],_empresa)
        );
        emit CreacionCliente(_empresa, DirContratosClientes[msg.sender]);
    }
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./models/InfoContrato.sol";
import "./models/Factory.sol";
import "./libraries/Validations.sol";
import "./Cliente.sol";

contract MvmClienteFactory is Factory {
    mapping(address => address) public DirContratosClientes;

    constructor(address _reguladorMercado) {
        owner = msg.sender;
        dirContrato = address(this);
        reguladorMercado = _reguladorMercado;
    }

    function FactoryContrato(InfoContrato memory _infoContrato)
        public
        override
        canCreate
    {
        require(
            Validations.aproveCreation(_infoContrato.owner, contratosOwners),
            "El cliente ya existe"
        );
        DirContratosClientes[_infoContrato.owner] = address(
            new Cliente(_infoContrato, reguladorMercado)
        );
        _infoContrato.dirContrato = DirContratosClientes[_infoContrato.owner];
        diligenciarContratoRegulador(_infoContrato.owner, _infoContrato);
        contratosOwners.push(
            Cliente(DirContratosClientes[_infoContrato.owner]).getInfoContrato()
        );
        emit Creacion(
            _infoContrato.empresa,
            DirContratosClientes[_infoContrato.owner]
        );
    }
}
